INSERT INTO reservoirs(id, city, create_date, description, information, latitude, longitude, main_url_image, name,
                       reservoir_type,
                       country_id, user_id, modified_date, i_frame_map)
VALUES (1, 'София', '2024-04-18 21:52:00.000000',
        'Язовир Искър\r\nТой е най-големият по площ и обем язовир в България. Разположен е на река Искър, в Панчаревския пролом. Водоемът е затворен от планина Плана на запад и Лозенската планина на север. Намира се между градовете София и Самоков. Използва се за водоснабдяване на столицата и за производство на електроенергия.\r\n\r\nСтената на язовира е дълга 204 метра и е висока 76, прегражда дълбок каньон от руслото на река Искър. Язовирът е дълъг 13,5 км, водната му площ е 30 кв. км и осигурява впечатляващ воден обем от над 600 куб. метра.\r\nСпоред данни на компания „Софийска вода“, нуждата от построяване на язовир на река Искър е определена още през 1900 г. В началото на 1948 г. започва работата по проектите. Бившият кмет на София инж. Иван Иванов, осъден на смърт от народния съд, бива помилван на доживотен затвор, в замяна за проектирането на язовир Искър.  На 6 септември 1954 г. хидровъзелът е открит официално.\r\n\r\nДнес това е един от най-предпочитаните водоеми от столичани, поради красивата си природа и голямото количество риба. Ако сте риболовец, там може да уловите костур, сом, бяла риба, уклей, червеноперка, каракуда, бабушка, скобар, шаран, платика и клен.\r\n\r\nНа устието се намират местностите Багера и Римския мост. Стръмният бряг няма да ви попречи на добрия риболов. Средните дълбочини са около 2,5-3 метра. Също така предпочитани места от риболовците са устието на река Искър и Шипочанския залив.\r\nНа юг в далечината се виждат красивите била на Рила. Освен за риболов, язовир Искър е подходящ за разходка, пикник, къмпингуване, както и за плаване с лодка или яхта, или с обикновено водно колело.',
        'Той е най-големият по площ и обем язовир в България. Разположен е на река Искър, в Панчаревския пролом.',
        '3123', '12312',
        'https://res.cloudinary.com/dsy8h2u3x/image/upload/v1713477071/Reservoirs/Iskur/q9v0ms0fvlbtae0jdw4j.png',
        'Искър', 'СВОБОДЕН', 1, 1, NULL,
        'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d47092.49908184707!2d23.539323441128165!3d42.46430786459705!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x14ab327902d32543%3A0x171bd4577dc1a610!2z0Y_Qty4g0JjRgdC60YrRgA!5e0!3m2!1sbg!2sbg!4v1713905961604!5m2!1sbg!2sbg'),
       (2, 'Западните Родопи', '2024-04-18 22:03:00.000000',
        'Намира се в Западните Родопи, в непосредствена близост до град Доспат, на 1200 метра надморска височина. Язовир Доспат е един от най-големите по площ язовири в България, вторият по големина, след Искър. Пуснат е в действие през 1967 г. Язовирът е с дължина 19 км и е широк около 3 км, а средната му дълбочина е 40 метра. Той е част от водноелектрическа каскада „Доспат – Въча“ и е най-големият хидроенергиен комплекс в България.\r\nЯзовир Доспат предлага много места с красива гледка. Предпочитано място е от много хора за къмпинг. Подходящ е и за риболов. На него може да се лови шаран, пъстърва, кефал и каракуда.\r\n\r\nПътят към язовир Доспат минава през много красиви местности. Ако минавате през Пазарджик и Батак, ще имате възможността да видите и язовирите Батак, Беглика, Голям Беглик и Широка поляна. Също по този път, на влизане в Доспат има обособена панорамна площадка, от която се открива прекрасен изглед към язовира. Мястото е особено предпочитано по залез. Ако идвате от Велинград и Сърница, ще видите горната част на язовир Доспат откъм Сърница.',
        'Язовир Доспат се намира в Западните Родопи в непосредствена близост до град Доспат, на 1200 метра надморска височина. Tой е един от най-големите по площ язовири в България.',
        '2313', '123312',
        'https://res.cloudinary.com/dsy8h2u3x/image/upload/v1713477934/Reservoirs/Dospat/rcufhpehcjn90o4v5hic.jpg',
        'Доспат', 'СВОБОДЕН', 1, 1, NULL,
        'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d47669.69166502857!2d24.0696873933208!3d41.69125574908539!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x14ab86facf9ab4f5%3A0xc77885ab03e0eaae!2z0Y_Qty4g0JTQvtGB0L_QsNGC!5e0!3m2!1sbg!2sbg!4v1713906002202!5m2!1sbg!2sbg'),
       (3, 'Западните Родопи', '2024-04-18 22:11:00.000000',
        'Разположен в Западните Родопи, язовир Батак се намира се на 4 км от град Батак, област Пазарджик. Площта му е 22 кв. км. Построен е по поречието на р. Мътница през далечната 1959 година в така нареченото „Баташко плато“.\r\nАтрактивна гледка е разположеният в язовира остров, който се казва Голака. Язовир Батак е едно от най-предпочитаните места за почивка и риболов. На единия му бряг (в западната част) се намира известният планински курорт „Цигов Чарк“, а на другия – летовището „Дъното“.\r\n\r\nЯзовирът е предпочитана дестинация през всички сезони. През пролетта и лятото може да се възползвате от много изградени туристически маршрути, предлагащи невероятно красиви гледки, полегати склонове. Има възможности за практикуване на различни видове спорт. През зимата курортът е подходящ за ски туризъм и разполага с влек.\r\nВ източната част на язовира се намира летовището „Дъното“, подходящо място за почитателите на лагеруване, къмпинг и риболов.\r\nОт най-северната част на язовира се разкрива прекрасна гледка по цялата му дължина.\r\n\r\nЯзовир Батак е на 75 км от Пловдив и на 150 км от София. Ако идвате от Югозападна България, до язовир Батак може да стигнете през Разлог – Велинград – Ракитово, а ако пътувате от Северна или Югоизточна България, вариантите са:\r\n\r\nпо автомагистрала Тракия, до Пазарджик и след това през Пещера – язовир Батак\r\nпо автомагистрала Тракия, до Пловдив и след това през Исперихово – Пещера – Язовир Батак.\r\nВсички изброени маршрути са в добро състояние, но последните отсечки от маршрута са планински пътища и има доста завои.',
        'Разположен в Западните Родопи, язовир Батак се намира се на 4 км от град Батак, област Пазарджик. Площта му е 22 кв. км. ',
        '31312', '321312',
        'https://res.cloudinary.com/dsy8h2u3x/image/upload/v1713478240/Reservoirs/Batak/uoy7c4f5zzqihsemldsj.jpg',
        'Батак', 'СВОБОДЕН', 1, 1, '2024-04-30 20:15:34.265645',
        'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d47459.66355929273!2d24.161249390640474!3d41.97389344054144!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x14ac9db8f021ec4d%3A0x74e0a98c4ecaf99b!2z0Y_Qty4g0JHQsNGC0LDQug!5e0!3m2!1sbg!2sbg!4v1713905734995!5m2!1sbg!2sbg'),
       (6, 'Кърджали', '2024-04-16 22:34:00.000000',
        'Язовир Кърджали се намира само на 3 км северозападно от град Кърджали. Той е третият по големина язовир в България (497,2 млн. кубични метра воден обем), който акумулира водите на река Арда. Язовирната стена е бетонна, дъгово-гравитачна – тя е единствената в България с такава конструкция. Максималната ѝ височина от основата е 103 метра, а дължината по короната – 344 метра. Това е третата най-висока стена на язовир в страната.\r\nТой често е предпочитано място за отмора, отдих и бягство от забързаното ежедневие. Пред посетителите се разкриват невероятни гледки и потапяне в атмосферата на източните Родопи. Край язовира могат да бъдат видени красиви заливи, заобиколени от любопитни скални форми и стръмни хълмове.\r\n\r\nЦелогодишно на язовир „Кърджали“ може да се практикуват различни спортове и туризъм. Покрай него са изградени хотели, къщи за гости и места за къмпингуване и риболов.\r\n\r\nЯзовир Кърджали е един от най–богатите на риба водоеми в страната, като тук предпочитан е уловът на едър сом. Могат да бъдат уловени още шаран, костур, пъстърва, червеноперка, уклей, буфало, амур, есетра, мряна, морун и други.\r\n\r\nЗа да стигнете до язовир Кърджали, имате два варианта. Първият е като ползвате за  отправна точка град Асеновград, оттам се движите през селата Новаково и Тополово, Жълт камък, Каблешково, Костино и Копривец. След това пред вас ще се появи величественият язовир. Вторият вариант е да минете през Първомай, Минерални бани и оттам през селата Каблешково, Костино и Копривец.\r\nПътят е двулентов и може да не е в много добро състояние, затова е важно да внимавате със скоростта.',
        'Язовир Кърджали се намира само на 3 км северозападно от град Кърджали. Той е третият по големина язовир в България (497,2 млн. кубични метра воден обем), който акумулира водите на река Арда.',
        '231312', '312321',
        'https://res.cloudinary.com/dsy8h2u3x/image/upload/v1713479037/Reservoirs/kurdjeli/yky42nsmghixkadke15o.jpg',
        'Кърджали', 'СВОБОДЕН', 1, 1, NULL,
        'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d47693.10539530959!2d25.257446916919456!3d41.65965066070504!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x14ad0d42e73f6f21%3A0x5e2be71d20e4d012!2z0Y_Qty4g0JrRitGA0LTQttCw0LvQuA!5e0!3m2!1sbg!2sbg!4v1713906086397!5m2!1sbg!2sbg'),
       (7, 'централна България', '2024-04-18 22:46:00.000000',
        '„Жребчево“ е язовир в централна България, изграден на река Тунджа, между планините Средна гора и Стара Планина. Наименованието му идва от останалото на дъното му село Жребчево. Той е четвърти по площ и пети по обем сред язовирите в България.\r\nНамира се в красива подпланинска местност. Площта му се простира от градовете Николаево и Гурково, и село Паничерево (Област Стара Загора), през Община Твърдица, до селата Баня и Асеновец в Община Нова Загора (Област Сливен).\r\n\r\nЯзовирът има много ръкави с удобни места за риболов. Тъй като водата от него се използва за напояване, през лятото той се източва значително. По тази причина риболовът е сезонен. В него могат да бъдат уловени щука, сом, шаран, костур и червеноперки.\r\n\r\nВ околностите на яз. Жребчево са разположени множество вилни зони и почивни станции, както и места за къмпингуване.\r\n\r\nОсвен за риболов и къмпинг, язовирът е подходящ и за водни спортове. Организират се различни състезания по кану – каяк и плуване в кристалните води на Жребчево.\r\nНапоследък, поради намалелия обем на язовира, интерес предизвиква църквата „Св. Иван Рилски“, която е била потопена при построяването на язовира, но сега е постоянно открита. Тя се превърна в атракция, която привлича туристи от цялата страна.',
        '„Жребчево“ е язовир в централна България, изграден на река Тунджа, между планините Средна гора и Стара Планина. ',
        '321', '312',
        'https://res.cloudinary.com/dsy8h2u3x/image/upload/v1713480338/Reservoirs/Jrebchevo/jovppxryuv3l3bpzb5ge.jpg',
        'Жребчево', 'СВОБОДЕН', 1, 1, NULL,
        'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d46980.28743137289!2d25.858391278795352!3d42.61327264545709!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x40a8897817aef953%3A0x75b330b32029da17!2z0Y_Qty4g0JbRgNC10LHRh9C10LLQvg!5e0!3m2!1sbg!2sbg!4v1713906122504!5m2!1sbg!2sbg'),
       (8, 'Батак', '2024-04-18 23:01:00.000000',
        'Язовир Голям Беглик се намира близо до Батак, в Западните Родопи, на около 60 км от Пазарджик. Намира се на 1500 метра надморска височина. Старото му име е Васил Коларов. Открит е през 1951 г., като е бил проектиран за напоителен язовир, но днес се използва и за захранване на ВЕЦ-ове.\r\nЯзовирът е обграден от три защитени местности: Горски център “ Чатъма”, Самодивска поляна и Батлъбоаз. Там има възможност за къмпингуване, а ако решите да се разходите, не пропускайте екопътека Беглика. Забележителности наблизо са водопадите Фотински и Късак. Наблизо е и язовир Беглика, а язовир Широка поляна е на 12 км.\r\n\r\nНа Голям Беглик има добри условия за риболов на бабушка, балканска пъстърва, речен кефал, костур, червеноперка и шаран.\r\n\r\nЗа да стигнете до язовир Голям Беглик, едната възможност е идвайки от град Пещера, и след това по пътя за Батак. Друг вариант е идвайки от София, да минете през град Септември и следвайки пътя на тестолинейката Септември- Добринище, малко преди да стигнете Велинград, да се отклоните вляво към Ракитово, Цигов Чарк и вдясно от него да хванете пътя за язовир Голям Беглик.',
        'Язовир Голям Беглик се намира близо до Батак, в Западните Родопи, на около 60 км от Пазарджик. Намира се на 1500 метра надморска височина. Старото му име е Васил Коларов.',
        '2312', '312',
        'https://res.cloudinary.com/dsy8h2u3x/image/upload/v1713481209/Reservoirs/Goliam%20Beglik/tegcpfm31mefkgf6ne0e.jpg',
        'Голям Беглик', 'СВОБОДЕН', 1, 1, '2024-04-29 02:50:15.702014',
        'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d23793.899324442496!2d24.091996192350432!3d41.801645702503045!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x14ab7f9a453abf15%3A0x27257cae642896bd!2z0Y_Qty4g0JPQvtC70Y_QvCDQkdC10LPQu9C40Lo!5e0!3m2!1sbg!2sbg!4v1713905837443!5m2!1sbg!2sbg'),
       (9, 'Елена', '2024-04-18 23:08:00.000000',
        'Йовковци е името на един от най-големите по площ язовири в България. Изграден е на река Веселина, близо до град Елена. Намира се на територията на община Елена и обслужва нуждите от питейна вода на около 250 000 души в област Велико Търново и съседни области. Общият му обем е 92 179 000 m³.\r\nЯзовирът носи името на едно от разрушените при построяването му села, което сега се намира под водата.\r\n\r\nМестоположението на язовир Йовковци, а именно в сърцето на Еленския Балкан, е предпоставка за добре развит туризъм и голямо разнообразие от места за настаняване. Наблизо има конна база, възможности за практикуване на водни спортове, плаване с лодка и разбира се, места, подходящи за семейни ваканции и пикник.\r\n\r\nВодоемът е подходящ и за риболов. Той е зарибен с над 10 вида риби: шарани, толстолоби, едри костури и бели риби, големи щуки, кленове, сомове, червеноперки и костури.\r\n\r\nЯзовирът се намира на 5 км западно от град Елена. До него може да стигнете като се движите по главния път в град Елена, в посока село Яковци. Ще достигнете до разклонение, на което има чешма. Там може да поемете в две посоки, като и двете ще ви отведат до язовира, но в различни негови части.',
        'Йовковци е името на един от най-големите по площ язовири в България. Изграден е на река Веселина, близо до град Елена. Намира се на територията на община Елена и обслужва нуждите от питейна вода на около 250 000 души в област Велико Търново',
        '321', '54132',
        'https://res.cloudinary.com/dsy8h2u3x/image/upload/v1713481648/Reservoirs/Iovkovci/vdodlxaw0zvrz1ihol13.jpg',
        'Йовковци', 'СВОБОДЕН', 1, 1, NULL,
        'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d23369.62714833881!2d25.77257899097595!3d42.93183880985285!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x40a8dd10eedb8a5b%3A0x1245b35cdcd25bc6!2z0Y_Qty4g0JnQvtCy0LrQvtCy0YbQuA!5e0!3m2!1sbg!2sbg!4v1713906163174!5m2!1sbg!2sbg'),
       (10, 'Казанлък', '2024-04-18 23:13:00.000000',
        'Язовир Копринка е разположен по поречието на река Тунджа. Намира се на 7 км западно от град Казанлък, като на източния му бряг се намира и едноименното селце. До 1992 г. съоръжението носи името яз. „Георги Димитров“.\r\n\r\nПри строителството на язовир „Копринка“ е разкопан и изцяло проучен тракийският град Севтополис, от специалисти археолози към Археологически институт при БАН. Днес неговите останки са на дъното на язовира.\r\nДължината на язовира е около 7 км и има множество ръкави и заливи. Височината на язовирната стена е 44,0 м, а дължината по короната е 834 м. Районът наоколо предлага много добри условия за риболов, туризъм и водни спортове.\r\n\r\nПо ръкавите му има много заливи, на които може да се плажува. Тук може да пробвате да карате каяк или да опитате някой друг воден спорт – например яхтинг, сърфинг или подводно гмуркане. Любителите на екстремните спортове могат да практикуват делта или парапланеризъм ида видят отвисоко пъстротата на Розовата долина.\r\nДългата язовирна стена, тип – каменно-зидана, позволява свободното преминаване от северния към южния бряг на съоръжението. Така пред разхождащите се разкрива прекрасна панорамна гледка към водното огледало в подножието на планината.\r\n\r\nЗабележителности наоколо са Паметникът Шипка (27 км), в град Казанлък – археологически музей „Искра“, Тракийската гробница, Музея на розата, Комплекс „Дамасцена“ и други.',
        'Язовир Копринка е разположен по поречието на река Тунджа. Намира се на 7 км западно от град Казанлък, като на източния му бряг се намира и едноименното селце. До 1992 г. съоръжението носи името яз. „Георги Димитров“.',
        '4124', '4132',
        'https://res.cloudinary.com/dsy8h2u3x/image/upload/v1713481911/Reservoirs/Koprinka/gvakfkexxnzgjmkewica.jpg',
        'Копринка', 'СВОБОДЕН', 1, 1, NULL,
        'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d23487.98642312729!2d25.277125132275753!3d42.618991993594825!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x40a9acd47400bb65%3A0xc8e9ae4b900bd120!2z0Y_Qty4g0JrQvtC_0YDQuNC90LrQsA!5e0!3m2!1sbg!2sbg!4v1713906198084!5m2!1sbg!2sbg'),
       (11, 'Западните Родопи', '2024-04-18 23:17:00.000000',
        'Язовир Широка поляна се намира на 1540 метра надморска височина, в Западните Родопи, южно от град Батак. Той е построен през 1962 година. Близо до него има три защитени местности: Широка поляна, на север, Студената чучурка, на юг и Кавал тепе, на изток.\r\n\r\nВодоемът има изградена язовира стена, висока 21 метра, дълга 498 метра. Общата му площ е 4,3 квадратни километра, разполага с воден обем 24 000 000 кубични метра.\r\n\r\nЯзовирът е изграден на място, където преди е имало пасищна долина. Днес около язовира, в хубаво време, има много хора, които се разхождат. Той е и предпочитано място за къмпингуване. Никак не са малко и хората, които ловят риба, поради наличието на различни видове риба: речен кефал, американска пъстърва, балканска пъстърва, костур, шаран, сом, червеноперка, златиста каракуда, сребриста каракуда, бял амур.\r\n\r\nНаблизо има друг красив язовир – Голям Беглик, на 6,5 километра северно. Панорамната площадка над язовир Доспат пък е на около 12 километра южно.\r\n\r\nДо язовир Широка поляна се стига лесно, той е на около 30 км от Батак, на пътя към Доспат.',
        'Язовир Широка поляна се намира на 1540 метра надморска височина, в Западните Родопи, южно от град Батак. Той е построен през 1962 година. ',
        '23424', '43215',
        'https://res.cloudinary.com/dsy8h2u3x/image/upload/v1713482201/Reservoirs/Shiroka%20Poliana/fx6mhzrgprmsxzus7tfs.jpg',
        'Широка поляна', 'СВОБОДЕН', 1, 1, NULL,
        'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d11904.5533203039!2d24.15973776311208!3d41.760675268377234!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x14ac7feac6ca0597%3A0xa1a41bccf3acb2d5!2z0Y_Qty4g0KjQuNGA0L7QutCwINC_0L7Qu9GP0L3QsA!5e0!3m2!1sbg!2sbg!4v1713906263409!5m2!1sbg!2sbg'),
       (13, 'Крумовград', '2024-04-20 03:01:00.000000',
        'Един от предпочитаните живописни язовири в Родопите е язовир Студен кладенец. Той е вторият язовир на река Арда, след Кърджали. Намира се на границата между общините Кърджали и Крумовград, а площта му е 27 кв. км. Височината на язовирната стена достига 68 метра в най-високата си част, а дължината й е 350 метра. В основата ширината на стената достига 61 метра, а в короната – 8 м.\r\nОсвен красивите меандри и брегове на язовира, красотата на Студен кладенец се допълва и от издигащите се от двете му страни крепости – Моняк и Вишеград, до които е приятно да се разходите, надниквайки към миналото. Поради това, че крепостта Моняк е и една от най-високоразположените, от нея се откриват чудни гледки към язовира.\r\n\r\nВ района на едно от големите уширения на язовира в района на с. Широко поле има условия за отдих и риболов. Следващият залив, при с. Калоянци, също е един от предпочитаните за риболов. Там е и един от по-големите острови, до който може да се стигне с лодка. Преди 30 г. той е бил заселен с муфлони, а сега често до него плуват сърни, идващи от горското стопанство.\r\n\r\nС голямата си водна повърхност и дължина (27,8 кв. км площ) язовирът дава прекрасни възможности за риболов и водни спортове. Най-често срещаните видове риби са: шаран, толстолоб, бял амур, сом, червеноперка, бабушка, каракуда (таранка, карас) и костур.\r\n\r\nВ пролома се намират уникалните природни забележителности Абразивни кладенци и Дяволски мост.\r\n\r\nУикендът или ваканцията, прекарани по бреговете на язовир Студен кладенец несъмнено биха били запомнящи се.',
        'Един от предпочитаните живописни язовири в Родопите е язовир Студен кладенец. Той е вторият язовир на река Арда, след Кърджали. Намира се на границата между общините Кърджали и Крумовград, а площта му е 27 кв. км. ',
        '3213', '123',
        'https://res.cloudinary.com/dsy8h2u3x/image/upload/v1713571227/Reservoirs/Studen%20Kladenec/kmoyo4mwhv28w1l1xexx.jpg',
        'Студен кладенец', 'СВОБОДЕН', 1, 1, NULL,
        'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d95428.13534409352!2d25.473554469979057!3d41.631338039730316!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x14ad653bc124b53d%3A0x7ccc362d6d3f0c24!2z0Y_Qty4g0YHRgtGD0LTQtdC9INCa0LvQsNC00LXQvdC10YY!5e0!3m2!1sbg!2sbg!4v1713906319558!5m2!1sbg!2sbg'),
       (14, 'Хирево', '2024-04-20 03:08:00.000000', 'Спортен Риболов',
        'Язовир за спортен риболов Kulekov Lake е място за отдих и забавление. Намира се до с.Хирево - на 10км от гр.Севлиево.',
        '3414', '12442',
        'https://res.cloudinary.com/dsy8h2u3x/image/upload/v1713571600/Reservoirs/Kulekov%20lake/oprl2iqhrkcby09yq15x.jpg',
        'Кулеков Лейк', 'ЧАСТЕН', 1, 1, NULL,
        'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2918.837296418494!2d24.981946272921643!3d42.98170089335545!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x40a96f2bd8fd1601%3A0xa47abf2e8c92fda5!2z0JrRg9C70LXQutC-0LIg0JvQtdC50Lo!5e0!3m2!1sbg!2sbg!4v1713906364297!5m2!1sbg!2sbg'),
       (15, 'Пловдивв', '2024-04-20 03:14:00.000000', 'Борец десцкрипт карп', 'Борец информация', '9872', '7892',
        'https://res.cloudinary.com/dsy8h2u3x/image/upload/v1713571954/Reservoirs/Borec/wlspabwgbarc8aagnywp.jpg',
        'Борец', 'ЧАСТЕН', 1, 1, '2024-04-30 02:01:28.019961',
        'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d5897.406749846417!2d24.948597981062306!3d42.34884710499078!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x40a9cd8b6d7d6077%3A0x619463493c997fd1!2z0Y_Qty4g0JHQvtGA0LXRhg!5e0!3m2!1sbg!2sbg!4v1713905901724!5m2!1sbg!2sbg'),
       (16, 'Севлиево', '2024-04-20 03:20:00.000000',
        'Язовир Кастел се намира в околностите на село Кастел, община Севлиево. Изграден е на левия приток на река Росица. До стената му води асфалтов път, свързващ Батошево и Кастел. На язовира има 10 места, специално подготвени за хора на палатки. Основното правило на язовира е, че всички риби над 3 кг трябва да се върнат обратно във водоема.\r\n\r\nКато локация избрахме леснодостъпно място в близост до пътя, откъдето се разкрива гледка към язовира.',
        'Язовир Кастел се намира в околностите на село Кастел, община Севлиево', '42314', '1423',
        'https://res.cloudinary.com/dsy8h2u3x/image/upload/v1713572325/Reservoirs/Kastel/rxi4iugrktdzb8nvw4ws.jpg',
        'Кастел', 'ЧАСТЕН', 1, 1, NULL,
        'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2922.33772841302!2d25.10213654585111!3d42.907917792605865!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x40a90d5750ab897d%3A0xf5553bd49c5c9ead!2z0K_Ql9Ce0JLQmNCgINCa0JDQodCi0JXQmw!5e0!3m2!1sbg!2sbg!4v1713906427469!5m2!1sbg!2sbg');
